import { FiEdit2 } from "react-icons/fi";
import { FiTrash } from "react-icons/fi";
import { AiOutlineCalendar } from "react-icons/ai";

const Todo = ({ text }) => {
  return (
    <div className="w-full mt-2 bg-green-300 rounded-lg flex flex-col items-center justify-center p-3">
      <div className="flex">
        <div className="w-[90%] flex flex-col">

        </div>
        {/*<div className="w-[10%] flex flex-col justify-start items-center">
          <div className="w-7 h-7 bg-slate-700 flex items-center justify-center rounded-md">
            <FiEdit2 className="cursor-pointer text-white" />
          </div>
          <div className="w-7 h-7 mr-2 bg-slate-700 flex items-center justify-center rounded-md">
            <FiTrash className="cursor-pointer text-white" />
          </div>
        </div>*/}
      </div>
      <div className="flex flex-col items-end overflow-hidden w-full">
        <p className="select-none w-full truncate text-lg my-4 text-left">{text}</p>
        <span className="flex items-center text-slate-800 select-none">
          2/2021/12
          <AiOutlineCalendar className="mr-2 w-5 h-5" />
        </span>
        <span className="flex items-center text-slate-800 select-none">
          10:00
          <AiOutlineCalendar className="mr-2 w-5 h-5" />
        </span>
      </div>
    </div>
  );
}

export default Todo;
